window.bookSummaryJSON = "<p><b>She fought him. He claimed her anyway.</b><br> </p> <p>Ruari of Clan Dundalk knew Arielle was his mate as soon as he set eyes on her, but he had planned to court her properly. When she arrives in his lands as an uninvited stowaway, however, he decides it is time for this beautiful, headstrong female to be taught her place over his knee.<br> </p> <p>As she is led to her new mate's castle naked, blushing, and sore, with only a sheet to hide her helpless arousal, Arielle's fury at being bared and spanked is exceeded only by her desperate need to be thrown to the ground and ravaged by the brute who just punished her so shamefully.<br> </p> <p>She won't have to wait long....<br> </p> <p><b>Publisher's Note:</b> <i>Wolflord</i> is a stand-alone novel set in the same world as <i>Warlord</i> and <i>Overlord</i>. It includes spankings and sexual scenes. If such material offends you, please don't buy this book.</p>"; 
